import React from 'react'
import axios from 'axios';
import { useState, useEffect } from 'react';

const HomePage = () => {
  const [formData, setFormData] = useState({
    symbol_name: ''
  });
  const [watchList, setwatchList] = useState([]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('user/addSymbol/', formData);
      console.log(response.data);
      // Handle successful registration, maybe redirect to login page
    } catch (error) {
      console.error(error.response.data);
      // Handle registration error, maybe display error message
    }
  };

  useEffect(() => {
    console.log("I'm at use effect");
    const response = axios.get('user/getWatchList/');
    console.log(response.data);
    // setwatchList(response.data.watchList);
  },);


  return (
    <>
      <div>
        <form onSubmit={handleSubmit}>
          <input type="text" name="symbol_name" value={formData.symbol_name} onChange={handleChange} placeholder=" Add Symbol Name" required />
          <button type="submit">Add Symbol</button>
        </form>
      </div>

      <h1>{watchList}</h1>
    </>

  );
};

export default HomePage
